if mibBuilder.loadTexts: sigChanMcdnChanMaintenanceHandling.setStatus('mandatory')
if mibBuilder.loadTexts: sigChanMcdnChanMaintenanceHandling.setDescription('This attribute specifies handling of channel maintenance events such as locking and unlocking a channel or channel registration on start-up. The decision here is whether to send individual channel RESTART messages, SERVICE messages, or nothing. Note that channel registration only occurs after the global interface restart at startup. The attribute controls start-up handling absolutely, and channel lock and unlock conditionally. That is, setting this to enable SERVICE messages ensures SERVICE messages at start-up and whenever a channel goes into or out of service. However, if this is not set to enable SERVICE messaging, a RESTART is always sent on unlocking a channel. globalOnStartup provides the minimum required function at start- up, without any individual channel confirmation. Note that when this is set, channel RESTART is still used for channel unlock. globalOnStartup applies to SigChan start-up only. serviceMessage enables sending and receiving SERVICE messages. If enabled, SERVICE messages are always used for channel maintenance on channel lock, channel unlock and start-up. restartMessage provides individual channel RESTARTs when a SigChan starts up. If enabled, the RESTART is used at start-up and channel unlock. However, if both SERVICE and RESTART messages are disabled, the RESTART will still be used when a channel unlocks.')
