sigChanMcdnClsFeaturesSupported = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 115, 17, 18, 1, 2), OctetString().subtype(subtypeSpec=ValueSizeConstraint(2, 2)).setFixedLength(2).clone(hexValue="ffc1")).setMaxAccess("readwrite")
if mibBuilder.loadTexts: sigChanMcdnClsFeaturesSupported.setStatus('mandatory')
if mibBuilder.loadTexts: sigChanMcdnClsFeaturesSupported.setDescription("This attribute specifies the features to be supported by MCDN 'TCAP' connectionless messaging. Note that some features such as Network ACD combine connectionless and connection oriented. In the NACD case, the connectionless messaging enables the source and target PBXs to establish the networked relationship, and calls sent across the network (connection oriented) will contain basic information relating the call to the feature. Feature Definitions: networkAcd: transfer of a call from a pool of agents to a second pool of agents across the network. networkMessageService: message waiting capability (for example, lamps on sets). Also includes signalling for voice mail, but is not limited to voice mail. networkVoiceMail: a specific subset of Network Message Service, separated functionally as it always terminates on an interactive voice response mailbox application. networkRingAgain: ring again to remote sets. electronicLock: change of set capabilities by a remote user dialling the applicable code and password. remoteCallForward: call forwarding a phone via applicable code and password. callPickupNetworkWide (call pickup world wide): scan for a ringing call on another node, to enable the scanning set to pick up the call. networkPackage1: a collection of other features including but not limited to network clock synchronization. Note that on the Meridian 1, this is a general purpose group used for very small features not requiring a new ISDN Facility feature type. isdnApplicationInterface: network wide support of a number of Meridian 1 Application Module Link features. mobilityMultisiteNetworking: the capability to use a wireless phone in multiple sites, by having the phone register on arrival at the new site, and having the PBX at the new site negotiate the set 'relocation' with the base PBX. miscellaneous: Any feature that is not listed above. Description of bits: networkAcd(0) networkMessageService(1) networkRingAgain(2) networkVoiceMail(3) electronicLock(4) remoteCallForward(5) callPickupWorldWide(6) networkPackage1(7) isdnApplicationInterface(8) mobilityMultisiteNetworking(9) notused10(10) notused11(11) notused12(12) notused13(13) notused14(14) miscellaneous(15)")
