if mibBuilder.loadTexts: sigChanMcdnNetworkNameDisplay.setStatus('mandatory')
if mibBuilder.loadTexts: sigChanMcdnNetworkNameDisplay.setDescription('This attribute specifies what Name Display is supported. nd1 corresponds to the Meridian 1 RCAP (Remote CAPability) nd1. This translates as caller provides name info in SETUP, ringing party name in ALERTING, redirection name in NOTIFY, and answering party name in CONNECT (as applicable, and if the name changes). nd2 corresponds to the Meridian 1 RCAP (Remote CAPability) nd2. This translates as caller provides name info in SETUP, answering party provides name in NOTIFY on answer. nd3 corresponds to the Meridian 1 RCAP (Remote CAPability) nd3, which is nd1 plus name information in call clearing messages (busy user, etc.) where a specific user was found but either could not answer or cleared the call. This corresponds to the QSIG name display. Description of bits: nameDisplay1(0) nameDisplay2(1) nameDisplay3(2)')
sigChanMcdnMultisiteBusinessGroup = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 115, 17, 19, 1, 7), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("transport", 0), ("discard", 1))).clone('transport')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: sigChanMcdnMultisiteBusinessGroup.setStatus('mandatory')
if mibBuilder.loadTexts: sigChanMcdnMultisiteBusinessGroup.setDescription("This attribute specifies whether to enable transport for the Meridian 1 Multisite Business Group IE. The Meridian 1 allows multiple 'Tenants' to exist on a single PBX. These Tenants have limited access to each other and to system resources. That is, users associated with 'Tenant group one' cannot use trunks, attendants, and features from another group, and so forth. The Multi-Site Business Group is a single Tenant existing on more than one PBX. As an example, 'tenant one' on a PBX may 'own' resources belonging to 'tenant one' on another PBX. The Multi-Site Business Group IE as used in the Meridian 1 Network Tenant Services feature enables linking the two tenants together.")
sigChanMcdnConOrFeaturesSupported = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 2, 4, 1, 115, 17, 19, 1, 8), OctetString().subtype(subtypeSpec=ValueSizeConstraint(2, 2)).setFixedLength(2).clone(hexValue="fff8")).setMaxAccess("readwrite")
if mibBuilder.loadTexts: sigChanMcdnConOrFeaturesSupported.setStatus('mandatory')
if mibBuilder.loadTexts: sigChanMcdnConOrFeaturesSupported.setDescription("This attribute indicates the features to be supported by MCDN 'ROSE' connection oriented messaging. Feature Definitions: networkAttendantService: network wide support of Attendant ('operator') services. classOfServiceTransport: this is not a ROSE feature. Class of Service transport takes place in the called party number when provisioned on the Meridian 1 to use an ESN signalling type. trunkRouteOptimization: dropping of redundant links in a call, when a set call forwards a call prior to answer. remoteVirtualQueuing: queuing at a remote node without requiring a B channel to be kept up. offHookQueuing: Queuing by maintaining the speech path to the queuing node. networkCallTrace: call progress tracing across a network (that is, call reached node a, node b, terminated at c,...). networkIntercom: network wide access to an intercom system onm a Meridian 1. callPickupNetworkWide: connection oriented messages associated with the TCAP call pickup scan operation. The messages that actually pick up the ringing call. radioPaging: access to a radio paging system network wide, allowing single radio paging facilities in a relatively dense local PBX network. networkAccess: information to enable access to PBX features from outside the network. Additional data is provided to identify access capabilities for a spoecific call. (Similar to transmittiong authorization code capabilities network wide.) antiTromboning: actually includes two capabilities - NAS (Network Attendant Setvice) and Trunk Anti-Tromboning. Calls that exit the subnet to a PBX and are transferred back to a network number via the same D channel can be optimized. If PBX A (Passport A) calls across the subnet to Passport B, D channel Z, to PBX B, and PBX B transfers across D channel Z to Passport B and therefore to PBX C/Passport C, this allows tha call to simplify to PBX/Passport A to PBX/Passport C. miscellaneous: Any feature that is not listed above. Description of bits: networkAttendantService(0) classOfServiceTransport(1) trunkRouteOptimization(2) remoteVirtualQueuing(3) networkCallId(4) offHookQueuing(5) networkCallTrace(6) networkIntercom(7) callPickupNetworkWide(8) radioPaging(9) networkAccess(10) antiTromboning(11) miscellaneous(12)")
